import { Component } from '@angular/core';

@Component({
  selector: 'app-footer',
  template: `
    <footer class="navbar-brand">
      <div class="container content has-text-centered">
        <p>Made by Andrea, Davide, Domenico, Bruno</p>
      </div>
  </footer>
  `,
  styles: [
    
    `
p {
  clear: both;
  position: relative;
  height: 200px;
  margin-top: -200px;
}
`,
  ]
})
export class FooterComponent {

}
